from flask import Flask, redirect, url_for, render_template, request, session, flashfrom datetime import timedeltaapp = Flask(__name__)app.secret_key = "Your Mom Ugly"app.permanent_session_lifetime = timedelta(days=5)@app.route('/')def home():    return render_template('home.html')@app.route('/login', methods=['GET', 'POST'])def login():    error = None    if request.method == 'POST':        if request.form['username'] != 'admin' or request.form['password'] != 'admin':            error = 'Invalid Credentials. Please try again.'        else:            session['logged_in']=True            return redirect(url_for('welcome'))    return render_template('login.html', error=error)@app.route("/logout")def logout():    session.pop('logged_in', None)    return redirect(url_for("login"))@app.route("/admin")def admin():    return render_template('admin.html')@app.route("/prof")def welcome():    return render_template("welcome.html")@app.route("/home")def front():    return render_template("index.html")if __name__ == '__main__':    app.run(debug=True)